import React from 'react'
import './signup.css'
import {useFormik} from 'formik'
import axios from 'axios'
import * as Yup from 'yup'
import { toast } from 'react-toastify';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';


function Signup() {

    const initial={
        name:'',
        email:'',
        password:'',
    }

    const validate = Yup.object().shape({
      name: Yup.string()
        .min(2, 'Too Short!')
        .max(50, 'Too Long!')
        .required('Required'),
      email: Yup.string().email('Invalid email').required('Required'),
      password: Yup.string()
      .min(8, 'Password must be at least 8 characters')
      .required('Password is required'), 
   });

    const headers={
        "Content-Type":"application/json",
        "Accept":"application/json",
      }
    const submitdata=async(value)=>
    {
        const usedata=value
        const usedatas=JSON.stringify(usedata)
        console.warn(usedatas)
        try{
        const respo=await axios.post("/singup", `${usedatas}`,{headers:headers})
         console.warn(respo.data.message)
         toast(respo.data.message, {
            position: "top-right",
            autoClose: 2000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
        })
       }
       catch(errors)
       {
        toast(errors.response.data.message, {
            position: "top-right",
            autoClose: 2000,
            hideProgressBar: false,
            closeOnClick: true,
            pauseOnHover: true,
            draggable: true,
            progress: undefined,
            type: 'error'
        })
       }


    }

    const formik=useFormik(
        {
            initialValues:initial,
            onSubmit:submitdata,
            validationSchema:validate
        }
    )



  return (
    <>
     <ToastContainer
        position="top-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
      />
    <div className="log-containt">
    <div className='log-left'  style={{backgroundColor:'rgba(252,236,211,255)',filter: 'grayscale(20%)' }}>
    <img className='image-style' src={process.env.PUBLIC_URL + '/images/logotemp3.jpg'} />

    </div>
    <div className='log-right'>

    <div className="login-box">
  <h2>Signup</h2>
  <form  onSubmit={formik.handleSubmit}>
    <div className="user-box">
      <input type="text" name="name" value={formik.values.name} onChange={formik.handleChange} required="" />
      <label>Username</label>
      {formik.touched.name && formik.errors.name ? <div className='text-danger'>{formik.errors.name}</div> : null} 
    </div>
    <div className="user-box">
      <input type="text" name="email" value={formik.values.email} onChange={formik.handleChange} required="" />
      <label>Email</label>
      {formik.touched.email && formik.errors.email ? <div className='text-danger'>{formik.errors.email}</div> : null} 

    </div>
    <div className="user-box">
      <input type="password" name="password" value={formik.values.password} onChange={formik.handleChange} required="" style={{background:'none'}} />
      <label>Password</label>
      {formik.touched.password && formik.errors.name ? <div className='text-danger'>{formik.errors.name}</div> : null} 

    </div>
    <button type='submit'>
      <span></span>
      <span></span>
      <span></span>
      <span></span>
      Submit
    </button>
  </form>
</div>


    </div>
    </div>
    </>
  )
}

export default Signup
